import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="passwords-list">
      <h1>Passwords List</h1>
      <form>
        <input type="text" placeholder="Please enter your password" />
        <button className="button"></button>
      </form>
    </div>
  );
}

export default App;
